import { Divider, Typography } from "@mui/material";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import { useState } from "react";
import Box from "@mui/material/Box";
import FormControl from "@mui/material/FormControl";
import InputLabel from "@mui/material/InputLabel";
import Select from "@mui/material/Select";
import MenuItem from "@mui/material/MenuItem";
import Button from "@mui/material/Button";

export default function CreateListing(){

let testAmenities = [
    "hot tub", "grill", "pool table"
]

const [title, setTitle] = useState('');
const [rate, setRate] = useState();
const [location, setLocation] = useState('');
const [description, setDescription] = useState('');
const [amenities, setAmenities] = useState(testAmenities);

const handleTitleChange = (e) => {
    setTitle(e.target.value);
}
const handleRateChange = (e) => {
    setRate(e.target.value);
}
const handleLocationChange = (e) => {
    setLocation(e.target.value);
}
const handleDescriptionChange = (e) => {
    setDescription(e.target.value);
}
const handleClickAmenity = (e) => {

}
const mapAmenities = () => {

    return amenities.map(function(val, index){
        return(
            <MenuItem key={index} value={val}>{val}</MenuItem>
        )
    })
}
const handleCustAmenityChange = (e) => {

}
const handleListingChange = () => {

}
    return(

        <div>
            <Typography variant="h4" sx={{justifyContent: 'center', display: 'flex',
            alignItems: 'center', margin:2}}>Create Your Listing</Typography>
            {/*here go the pics*/}
            <Divider sx={{backgroundColor:'peachpuff'}}/>
            <Grid container sx={{justifyContent: 'center', display: 'flex',
            alignItems: 'center', margin:2}}>
                <Grid xs={2}>
                    <Typography sx={{mt:2}} variant='h6'>Listing Title</Typography>
                    <TextField sx={{mb:2}} placeholder='Enter Title' onChange={handleTitleChange}/>
                </Grid>
                <Grid xs={2}>
                    <Typography sx={{mt:2}} variant='h6'>Nightly Rate</Typography>
                    <TextField sx={{mb:2}} placeholder='Enter Rate' onChange={handleRateChange}/>
                </Grid>
                <Grid xs={2}>
                    <Typography sx={{mt:2}} variant='h6'>Location</Typography>
                    <TextField sx={{mb:2}} placeholder='Enter Location' onChange={handleLocationChange}/>
                </Grid>
            </Grid>

            <Divider sx={{backgroundColor:'peachpuff'}}/>

            <Grid container sx={{justifyContent: 'center', display: 'flex',
            alignItems: 'center', margin:2}}>
                <Grid xs={6}>
                    <Typography sx={{mt:2}} variant='h6'>Description
                    </Typography>
                    <TextField fullWidth multiline rows={6} sx={{justifyContent: 'center', display: 'flex',
                    alignItems: 'center', mb:2}} placeholder='Describe the property...' onChange={handleDescriptionChange}/>
                </Grid>
            </Grid>

            <Divider sx={{backgroundColor:'peachpuff'}}/>

            <Grid container sx={{justifyContent: 'center', display: 'flex',
            alignItems: 'center', margin:2}}>
                <Grid xs={2}>
                    <Typography sx={{mt:2}} variant='h6'>Amenities</Typography>
                    <Box sx={{ maxWidth: 180 }}>
                        <FormControl fullWidth>
                            <InputLabel id="demo-simple-select-label">Amenities</InputLabel>
                            <Select
                                id="amenity-select"
                                value={amenities}
                                label="Amenities"
                                onChange={handleClickAmenity}
                            >
                                {mapAmenities()}
                            </Select>
                        </FormControl>
                     </Box>
                </Grid>
                <Grid xs={2}>
                    <Typography sx={{mt:2}} variant='h6'>Add Custom Amenity</Typography>
                    <TextField sx={{mb:2}} placeholder='Enter Amenity' onChange={handleCustAmenityChange}/>
                </Grid>
            </Grid>

            <Divider sx={{backgroundColor:'peachpuff'}}/>

            <Grid container sx={{justifyContent: 'center', display: 'flex',
            alignItems: 'center', margin:2}}>
                <Button variant="contained" sx={{backgroundColor:'lightsalmon', m:2}} onClick={handleListingChange}>Save</Button>
            </Grid>
        </div>

    )
}
